        for i in range(9):
            if puzzle[row][i] == num:
                return False
        for i in range(9):
            if puzzle[i][col] == num:
                return False
        box_row = row // 3 * 3
        box_col = col // 2 * 3
        for i in range(3):
            for j in range(3):
                if puzzle[box_row + i][box_col + j] == num:
                    return False
        return True
    for row in range(9):
        for col in range(9):
            if puzzle[row][col] == 0:
                for num in range(1, 10):
                    if is_valid(puzzle, row, col, num):
                        puzzle[row][col] = num
                        if solve_sudoku(puzzle):
                            return True
                        else:
                            puzzle[row][col] = 0
                return False
    return True

